  input: TEXT,"F3XA","","This amendment is in response to the Commission's letter
    dated April 12, 2006.  In regards to its best efforts procedures, the Committee
    mails requests for occupation and employer for those individuals exceeding $200
    in contributions for the year on a monthly basis.  Any updates to occupation and
    employer information that have been received are included in subsequent reports.  The
    disbursements for 'Fundraising Postage' were ongoing Federal fundraising efforts
    of the Committee.  No portion of these expenditures involved Public Communication,
    Voter Drive Activity, or Express Advocacy of a federal candidate. The difference
    in  the cash on hand between the Year End 2005 Report and the February Monthly
    2006 reports is the result of an ongoing audit underatken by the Committee for
    2005.  Once completed, the Committee will be refiling the reports for 2005 to
    the effect that the ending cash on hand for 2005 will match the beginning cash
    on hand for 2006."
